import { YMaps, Map, Placemark } from '@pbe/react-yandex-maps';
import styles from "./MyMap.module.css"

const MyMap = () => {
    return (
        <div className={styles.map_main}>
            <YMaps>
                <div className={styles.map}>
                
                <Map defaultState={{ 
                    center: [55.76, 37.63],
                     zoom: 10 
                     }}
                    width={"100vw"}>

                <Placemark geometry={[55.764041, 37.639305]} />

                </Map>
                </div>
            </YMaps>
        </div>
    )
}

export default MyMap
